    async function getSampleProject() {
        const sample = document.querySelector('meta[name="expressive:sample-project"]');
        if (!sample) {
            return defaultSampleProject();
        }
        const importer = new NativeAnimationImporter();
        const stream = (await (await fetch(sample.getAttribute('content'))).blob()).stream();
        const project = await importer.import(stream);
        importer.dispose();
        return project;
    }
    function defaultSampleProject() {
        const animators = new AnimatorSource();
        const project = new AnimationProject(animators);
        const doc = new AnimationDocument(new canvasEngine.Size(1200, 800));
        doc.title = 'Main document';
        doc.animation = new DocumentAnimation(doc, 0, 10000);
        const rect = new canvasEngine.RectElement(new canvasEngine.RectShape(100, 100), doc);
        rect.title = 'Rect 1';
        rect.fill = new canvasEngine.LinearGradientBrush(new canvasEngine.Point(0, 0), new canvasEngine.Point(100, 0), new canvasEngine.StopColorList([
            {
                offset: 0,
                color: canvasEngine.Color.parse('red')
            },
            {
                offset: 0.5,
                color: canvasEngine.Color.parse('yellow')
            },
            {
                offset: 1,
                color: canvasEngine.Color.parse('blue')
            }
        ]));
        rect.stroke = new canvasEngine.DefaultPen(new canvasEngine.SolidBrush(canvasEngine.Color.parse('blue')), 5);
        doc.appendChild(rect);
        const a1 = animators.createAnimation(rect, "position");
        a1.addKeyframeAtOffset(0, new canvasEngine.Point(0, 0));
        a1.addKeyframeAtOffset(2000, new canvasEngine.Point(100, 0));
        //a1.addKeyframeAtOffset(5000, new Point(500, 0));
        doc.animation.addAnimation(rect, "position", a1);
        const as1 = animators.createAnimation(rect, "strokeLineWidth");
        as1.addKeyframeAtOffset(0, 10);
        as1.addKeyframeAtOffset(2000, 20);
        //as1.addKeyframeAtOffset(4000, 30);
        doc.animation.addAnimation(rect, "strokeLineWidth", as1);
        const rect2 = new canvasEngine.RectElement(new canvasEngine.RectShape(300, 300), doc);
        rect2.title = 'Rect 2';
        rect2.fill = new canvasEngine.SolidBrush(canvasEngine.Color.parse('yellow'));
        rect2.stroke = new canvasEngine.DefaultPen(new canvasEngine.SolidBrush(canvasEngine.Color.parse('red')), 3);
        rect2.strokeDashArray = [1200];
        rect2.strokeLineWidth = 10;
        rect2.strokeLineCap = canvasEngine.StrokeLineCap.Square;
        const a2 = animators.createAnimation(rect2, "position");
        a2.addKeyframeAtOffset(1000, new canvasEngine.Point(0, 300));
        a2.addKeyframeAtOffset(3000, new canvasEngine.Point(400, 500));
        a2.addKeyframeAtOffset(5000, new canvasEngine.Point(800, 700));
        doc.animation.addAnimation(rect2, "position", a2);
        const dashAnim = animators.createAnimation(rect2, "strokeDashOffset");
        dashAnim.addKeyframeAtOffset(0, -1200);
        dashAnim.addKeyframeAtOffset(3000, 1200);
        doc.animation.addAnimation(rect2, "strokeDashOffset", dashAnim);
        const g1 = new canvasEngine.GroupElement(doc, 'test-group');
        g1.title = 'Group 1';
        g1.appendChild(rect2);
        doc.appendChild(g1);
        const rpoly1 = new canvasEngine.RegularPolygonElement(new canvasEngine.RegularPolygonShape(5, 100, 0, 0), doc);
        rpoly1.position = new canvasEngine.Point(300, 100);
        rpoly1.strokeBrush = canvasEngine.SolidBrush.fromColor('#ff00f2');
        rpoly1.strokeLineWidth = 5;
        doc.appendChild(rpoly1);
        const fColor = animators.createAnimation(rpoly1, "fill");
        fColor.addKeyframeAtOffset(0, canvasEngine.SolidBrush.fromColor('#a79cff'));
        fColor.addKeyframeAtOffset(2000, canvasEngine.SolidBrush.fromColor('#18f57f'));
        doc.animation.addAnimation(rpoly1, "fill", fColor);
        const star1 = new canvasEngine.StarElement(new canvasEngine.StarShape(5, 100, 40), doc);
        star1.position = new canvasEngine.Point(600, 300);
        star1.fill = canvasEngine.SolidBrush.fromColor("#11ccd6");
        star1.fillRule = canvasEngine.FillRule.EvenOdd;
        star1.strokeLineWidth = 0;
        star1.sides = 8;
        star1.outerRadius = 120;
        star1.innerRadius = 20;
        star1.outerCornerRadius = 0.9;
        star1.innerCornerRadius = 5;
        doc.appendChild(star1);
        const star1Anim = animators.createAnimation(star1, "outerRotate");
        star1Anim.addKeyframeAtOffset(0, 70);
        star1Anim.addKeyframeAtOffset(2000, 360 + 70);
        doc.animation.addAnimation(star1, "outerRotate", star1Anim);
        project.addDocument(doc);
        project.isRecording = false;
        project.masterDocument = doc;
        return project;
    }

